/*Table structure for table `student_master` */

CREATE TABLE `student_master` (
  `student_id` int(10) NOT NULL AUTO_INCREMENT,
  `reg_no` varchar(255) DEFAULT NULL,
  `form_sl_no` varchar(255) DEFAULT NULL,
  `admission_dt` datetime DEFAULT NULL,
  `dob` datetime DEFAULT NULL,
  `account_id` int(10) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `gender_id` int(10) DEFAULT NULL,
  `blood_gr_id` int(10) DEFAULT NULL,
  `caste_id` int(10) DEFAULT NULL,
  `religion_id` int(10) DEFAULT NULL,
  `father_name` varchar(255) DEFAULT NULL,
  `father_contact_no` varchar(25) DEFAULT NULL,
  `father_occupation_id` int(10) DEFAULT NULL,
  `fathers_income` varchar(255) DEFAULT NULL,
  `mother_name` varchar(255) DEFAULT NULL,
  `mother_contact_no` varchar(25) DEFAULT NULL,
  `mother_occupation_id` int(10) DEFAULT NULL,
  `mother_income` varchar(255) DEFAULT NULL,
  `guardian_name` varchar(225) DEFAULT NULL,
  `relationship_id` int(10) DEFAULT NULL,
  `present_area` varchar(255) DEFAULT NULL,
  `present_town` varchar(255) DEFAULT NULL,
  `present_po` varchar(255) DEFAULT NULL,
  `present_ps` varchar(255) DEFAULT NULL,
  `present_pin` varchar(20) DEFAULT NULL,
  `present_state_id` int(10) DEFAULT NULL,
  `present_dist_id` int(10) DEFAULT NULL,
  `area` varchar(255) DEFAULT NULL,
  `town` varchar(255) DEFAULT NULL,
  `post_office` varchar(255) DEFAULT NULL COMMENT 'Post Office',
  `police_station` varchar(255) DEFAULT NULL COMMENT 'Police Station',
  `pin_code` varchar(255) DEFAULT NULL,
  `state_id` int(10) DEFAULT NULL,
  `dist_id` int(10) DEFAULT NULL,
  `is_file_uploaded` enum('Y','N') DEFAULT NULL,
  `created_by` int(10) DEFAULT NULL,
  `is_active` tinyint(10) DEFAULT NULL,
  `created_on` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `last_modified` datetime DEFAULT NULL,
  PRIMARY KEY (`student_id`),
  UNIQUE KEY `reg_no` (`reg_no`)
) ENGINE=InnoDB AUTO_INCREMENT=145 DEFAULT CHARSET=utf8;

