/*Table structure for table `voucher_master` */

CREATE TABLE `voucher_master` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `voucher_number` varchar(255) DEFAULT NULL,
  `voucher_date` date DEFAULT NULL,
  `narration` varchar(255) DEFAULT NULL,
  `cheque_number` varchar(255) DEFAULT NULL,
  `cheque_date` date DEFAULT NULL,
  `chq_clear_on` datetime DEFAULT NULL,
  `is_chq_clear` enum('N','Y') DEFAULT NULL,
  `transaction_type` varchar(50) DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `school_id` int(11) DEFAULT NULL,
  `acdm_session_id` int(11) DEFAULT NULL,
  `accnt_year_id` int(11) DEFAULT NULL,
  `serial_number` int(11) NOT NULL,
  `is_frm_receipt` enum('Y','N') DEFAULT NULL,
  `vouchertype` varchar(10) DEFAULT NULL,
  `paid_to` varchar(100) DEFAULT NULL,
  `total_debit` float(10,2) NOT NULL,
  `total_credit` float(10,2) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_voucher_created_by` (`created_by`),
  KEY `FK_voucher_school_id` (`school_id`),
  KEY `FK_voucher_acdm_session_id` (`acdm_session_id`),
  CONSTRAINT `FK_voucher_acdm_session_id` FOREIGN KEY (`acdm_session_id`) REFERENCES `academic_session_master` (`id`),
  CONSTRAINT `FK_voucher_created_by` FOREIGN KEY (`created_by`) REFERENCES `admin_user` (`user_id`),
  CONSTRAINT `FK_voucher_school_id` FOREIGN KEY (`school_id`) REFERENCES `school_master` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=475 DEFAULT CHARSET=utf8;

